import "./Quations.scss";

export const Quations = () => {
  return (
    <div className="Quations">
      <div className="Quations-Title">Часто задаваемые вопросы</div>
      <div className="Quations">
        <button className="Quastion-statement-basic">
          <div className="Quastion-Statement">Скачать PDF</div>
        </button>
      </div>
    </div>
  );
};
